import React from "react";
import Sresult from "./Sresult";

const Search = () => {
    return(
        <>
            <div className="box_center">
                <div className="row">
                    <input 
                        type="text" 
                        placeholder="Search anything" 
                        style={{marginRight:"20px", marginTop:"30px"}}
                    />
                    <button 
                        style={{marginTop:"30px"}}
                        className="button"
                    > Search </button>
                </div>

                <div className="row">
                    <Sresult />
                </div>                
                </div>
                
        </>
    );
};
export default Search;
